//import logo from './logo.svg';

function About() {
  return (
    <div className="App">
      <header className="App-header">
        //<img src={logo} className="App-logo" alt="logo" />
        <p>
          This is the about page
        </p>
        <a
          className="App-link"
          href="./about"
          rel="noopener noreferrer"
        >
          To about
        </a>
      </header>
    </div>
  );
}

export default About;
